-- Name: user_last_activity; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.user_last_activity AS
 SELECT u.id,
    u.email,
    u.first_name,
    u.last_name,
    max(al.created_at) AS last_activity_at,
    EXTRACT(day FROM (now() - max(al.created_at))) AS days_inactive
   FROM (public.users u
     LEFT JOIN public.user_activity_log al ON ((u.id = al.user_id)))
  GROUP BY u.id, u.email, u.first_name, u.last_name;


