    CONSTRAINT user_moderation_action_type_check CHECK (((action_type)::text = ANY ((ARRAY['warning'::character varying, 'strike'::character varying, 'suspend'::character varying, 'ban'::character varying, 'restore'::character varying])::text[]))),
