--
-- Name: user_moderation_status; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.user_moderation_status AS
 SELECT u.id,
    u.email,
    u.first_name,
    u.last_name,
    count(
        CASE
            WHEN (((um.action_type)::text = 'warning'::text) AND um.is_active) THEN 1
            ELSE NULL::integer
        END) AS active_warnings,
    count(
        CASE
            WHEN (((um.action_type)::text = 'strike'::text) AND um.is_active) THEN 1
            ELSE NULL::integer
        END) AS active_strikes,
    max(
        CASE
            WHEN (((um.action_type)::text = 'suspend'::text) AND um.is_active) THEN um.suspension_end_date
            ELSE NULL::timestamp with time zone
        END) AS suspended_until,
        CASE
            WHEN (EXISTS ( SELECT 1
               FROM public.user_moderation
              WHERE ((user_moderation.user_id = u.id) AND ((user_moderation.action_type)::text = 'ban'::text) AND (user_moderation.is_active = true)))) THEN true
            ELSE false
        END AS is_banned,
    max(um.issued_at) AS last_moderation_date
   FROM (public.users u
     LEFT JOIN public.user_moderation um ON ((u.id = um.user_id)))
  GROUP BY u.id, u.email, u.first_name, u.last_name;


